I think the problem is that when you build wxWidgets, you didn&#39;t use
the wx_dll.dsw solution. One of the wxWidgets visual studio solutions
creates DLLs and the other creates static libraries. HyperNEAT was
built using the DLL version, so it tries to import all of the
functions from the dll. If you are trying to link with the static
libraries, then these imports will throw warnings.

